import React from "react";
import Dashboard from "../productimages/laptop.png";
import Android from "../productimages/andriod.png";
import "./product.css";

const Product = () => {
  return (
    <div className="product-container">
      <h2 className="product-heading">Product</h2>

      <div className="product-section">
        <div>
          <h3 className="product-card-heading">Dashboard</h3>
          <img src={Dashboard} alt="Dashboard" className="product-card-image" />
        </div>
        <p className="product-card-description">
          We have Sacco tools which will enable your Sacco to <b>APPROVE</b>, <b>TRACK</b> and <b>View Sacco ANALYTICS</b>.
        </p>
      </div>

      <div className="product-section">
        <div className="andriod">
          <h3 className="product-card-heading">Android App</h3>
          <p className="product-card-description">
            We have member tools which will enable your Sacco members to <b>SAVE</b>, <b>BORROW</b> and <b>REPAY</b> through their mobile phones.
          </p>
        </div>
        <img src={Android} alt="Android App" className="product-card-image2" />
      </div>
    </div>
  );
};

export default Product;
